import React from "react";
import JSONDATA from "./MOCK_DATA.json";

const TestHome = () => {
  return (
    <div>
      {JSONDATA.map((val, key) => {
        return <div>{val.Categories}</div>;
      })}
    </div>
  );
};

export default TestHome;
